using ObjectiveC;using System;using SharpSwift.Attributes;using System.Collections.Generic;using Foundation;using CoreGraphics;namespace UIKit{    /// <summary>    /// Delegates of a gesture recognizer—that is, an instance of a concrete subclass of UIGestureRecognizer—adopt the UIGestureRecognizerDelegate protocol to fine-tune an app’s gesture-recognition behavior. The delegates receive messages from a gesture recognizer, and their responses to these messages enable them to affect the operation of the gesture recognizer or to specify a relationship between it and another gesture recognizer, such as allowing simultaneous recognition or setting up a failure requirement.    /// </summary>    /// <see cref="https://developer.apple.com/library/prerelease/ios/documentation/UIKit/Reference/UIGestureRecognizerDelegate_Protocol/index.html#//apple_ref/occ/intf/UIGestureRecognizerDelegate"/>    [iOSVersion(3.2)]    public interface UIGestureRecognizerDelegate//: NSObjectProtocol    {        /// <summary>        /// Asks the delegate if a gesture recognizer should begin interpreting touches.        /// </summary>        /// <param name="gestureRecognizer">An instance of a subclass of the abstract base class UIGestureRecognizer. This gesture-recognizer object is about to begin processing touches to determine if its gesture is occurring.</param>        //[iOSVersion(3.2)]        //[Export("gestureRecognizerShouldBegin")]        //[Optional]        bool GestureRecognizerShouldBegin(UIGestureRecognizer gestureRecognizer);                /// <summary>        /// Ask the delegate if a gesture recognizer should receive an object representing a touch.        /// </summary>        /// <param name="gestureRecognizer">An instance of a subclass of the abstract base class UIGestureRecognizer.</param>        /// <param name="shouldReceiveTouch">A UITouch object from the current multi-touch sequence.</param>        //[iOSVersion(3.2)]        //[Export("gestureRecognizer")]        //[Optional]        bool GestureRecognizer(UIGestureRecognizer gestureRecognizer, UITouch shouldReceiveTouch);                /// <summary>        /// Asks the delegate if two gesture recognizers should be allowed to recognize gestures simultaneously.        /// </summary>        /// <param name="gestureRecognizer">An instance of a subclass of the abstract base class UIGestureRecognizer. This is the object sending the message to the delegate.</param>        /// <param name="shouldRecognizeSimultaneouslyWithGestureRecognizer">An instance of a subclass of the abstract base class UIGestureRecognizer.</param>        //[iOSVersion(3.2)]        //[Export("gestureRecognizer")]        //[Optional]        bool GestureRecognizer(UIGestureRecognizer gestureRecognizer, UIGestureRecognizer shouldRecognizeSimultaneouslyWithGestureRecognizer);                /// <summary>        /// Asks the delegate if a gesture recognizer should require another gesture recognizer to fail.        /// </summary>        /// <param name="gestureRecognizer">An instance of a subclass of the abstract base class UIGestureRecognizer. This is the object sending the message to the delegate.</param>        /// <param name="shouldRequireFailureOfGestureRecognizer">An instance of a subclass of the abstract base class UIGestureRecognizer.</param>        /// <param name="NAME_YOUR_PARAMS">DO NOT USE THIS PARAMETER - Instead make sure to name the parameters you're using.</param>        //[iOSVersion(7)]        //[Export("gestureRecognizer")]        //[Optional]        //[IgnoreParameter("NAME_YOUR_PARAMS")]        bool GestureRecognizer(UIGestureRecognizer gestureRecognizer, UIGestureRecognizer shouldRequireFailureOfGestureRecognizer, bool NAME_YOUR_PARAMS = false);                /// <summary>        /// Asks the delegate if a gesture recognizer should be required to fail by another gesture recognizer.        /// </summary>        /// <param name="gestureRecognizer">An instance of a subclass of the abstract base class UIGestureRecognizer. This is the object sending the message to the delegate.</param>        /// <param name="shouldBeRequiredToFailByGestureRecognizer">An instance of a subclass of the abstract base class UIGestureRecognizer.</param>        /// <param name="NAME_YOUR_PARAMS">DO NOT USE THIS PARAMETER - Instead make sure to name the parameters you're using.</param>        //[iOSVersion(7)]        //[Export("gestureRecognizer")]        //[Optional]        //[IgnoreParameter("NAME_YOUR_PARAMS")]        bool GestureRecognizer(UIGestureRecognizer gestureRecognizer, UIGestureRecognizer shouldBeRequiredToFailByGestureRecognizer, int NAME_YOUR_PARAMS = 0);    }}